The Weekly Line Up
]
[
]
[
Join us at Empire Lounge & Liquors
for an unforgettable lineup of themed event nights that cater to every taste and mood, ensuring you have a week filled with excitement, music, and good times!
]
]
]
]
]
[
[
[
[
[
Taco Tuesday
]
[
]
[
]
[
Kickstart your week with our mouthwatering Taco Tuesdays! Indulge in a delightful selection of delectable tacos, bursting with flavor and made with the freshest ingredients. Pair them with our signature cocktails for the perfect combination that will make your Tuesdays truly unforgettable.
]
]
]
[
[
[
Wednesdays - Karaoke and Games Night:
]
[
]
[
]
[
Unleash your inner superstar on Wednesdays for our Karaoke and Games Night! Grab the mic and sing your heart out or showcase your skills in a friendly game of pool, darts, or board games. It's a night of laughter, camaraderie, and thrilling entertainment for everyone.
]
]
]
]
]
[
[
[
[
[
Thursdays - Ladies Night:
]
[
]
[
]
[
Ladies, it's your time to shine! Join us on Thursdays for a night dedicated exclusively to you. Enjoy special drink offers and pamper yourselves with the finest cocktails while mingling with your best friends or meeting new like-minded ladies. It's the ultimate night of elegance and empowerment.
]
]
]
[
[
[
Fridays - Old School:
]
[
]
[
]
[
Get ready to groove to the timeless classics and nostalgic beats on our Old School Fridays. Step back in time and relive the golden era of music as our DJs spin the best hits from the past. Grab your dancing shoes and boogie the night away in the most vibrant atmosphere.
]
]
]
]
]
[
[
[
[
[
Saturdays - Club Reggae:
]
[
]
[
]
[
Transport yourself to the Jamaica with our Club Reggae Saturdays! Feel the rhythm of the island vibes as our DJs and live performers create an authentic reggae experience. Let the infectious beats and relaxed ambiance set the stage for an extraordinary Saturday night.
]
]
]
[
[
[
R &B Sunday Brunch
]
[
]
[
]
[
Empire is where Palm Beach comes to shut it down in style. We’re talkin’ bold beats, beautiful people, and bottle-poppin' energy from afternoon 'til night fall. This is the Sunday move. Brunch. Turn up. Repeat.
Book your section, bring your crew, and let’s make Sunday legendary
.
]
]
]
]
]
[
[
[
[
[
No matter which night you choose to join us, Empire Lounge promises an enchanting experience that will keep you coming back for more. Let the magic of each themed night elevate your spirits and create memories and experiences that last a lifetime.
]
]
