[
OUR STORY
]
[
]
[
Meet the dynamic power couple behind Empire Lounge & Liquors – Bull and Shernett. Hailing from Jamaica, their journey is a testament to hard work, determination, and a shared vision to create something extraordinary. What began as a single restaurant venture has now blossomed into an empire they proudly call their own.
Their unwavering dedication and commitment to excellence paid off when they became the owners of the entire plaza, taking charge of the spaces surrounding their restaurant. This allowed them to expand their vision and give birth to Empire Lounge & Liquors – a captivating urban haven that exudes elegance and allure.
